import { useEffect } from 'react'
import { useDataContext } from '../hooks/useDataContext'

const Home = () => {
  const {data, dispatch} = useDataContext()

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch('/api/datalog')
      const json = await response.json()


      if (response.ok) {
        dispatch({
          type: 'set_data',
          payload: json
        })
      }
    }
    fetchData();
  })

  return (
    <div className='home'>
      <h1>This Home</h1>
    </div>
  )
}

export default Home
